const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>The Meal Planning Web App</h1>
      <div className="links">
        <a href="/" style={{
          color: "white",
          backgroundColor: '#f1356d',
          borderRadius: '8px'
        }}>Home</a>
        <a href="/mealboard" style={{
          color: "white",
          backgroundColor: '#f1356d',
          borderRadius: '8px'
        }}>Meal Board</a>
      </div>
    </nav>
  )
}

export default Navbar;
